import React from 'react';
import Camera from 'react-html5-camera-photo';

function CameraPage () {

    const onTakePhoto = (dataUri) => {
        console.log('take photo');
    }

    return (
        <div className="camera">
            <Camera
                onTakePhoto = { (dataUri) => { onTakePhoto(dataUri); } }
            />
        </div>
    );
}

export default CameraPage;
